function(e, prez) {
var cert = document.createElement("canvas");
    $ = AP.$,
window._apDownloadOrEmailCertificate = function(el, emailOnly) {
	var stage = $(".ap-stage");
    var canvas = $(".ap-canvas");
	var scale = stage.width()/ canvas.width();
    var x = canvas.offset().left / scale;
    var y = canvas.offset().top / scale;

    $(cert).width(canvas.width()).height(canvas.height());
    $(cert).attr("width", canvas.width()).attr("height", canvas.height());
    var ctx = cert.getContext("2d");
    
    var fRenderElement = function(child){
        // Exclue download and email button
        if (child == $("#apBtnDownloadCert")[0] || child == $("#apBtnEmailCert")[0])
            return;
        var $child = $(child);
        if ($child.children().length == 0){
            var text = $child.text();
            if (text.length > 0){
                var align = $child.css("text-align");
                var tx = $child.offset().left / scale - x;
                var ty = $child.offset().top / scale - y + $child.height();
                if (align == "left") {
                    tx += 0;
                } else if (align == "right") {
                    tx += $child.width();
                } else {
                    tx += $child.width() / 2;
                }
                ctx.textAlign = align;
                var childFont = $child.css("font");
                if (childFont === '') {
                    var fontStyle = $child.css('font-style');
                    var fontVariant = $child.css('font-variant');
                    var fontWeight = $child.css('font-weight');
                    var fontSize = $child.css('font-size');
                    var fontFamily = $child.css('font-family');

                    var elementFont = (fontStyle + ' ' + fontVariant + ' ' + fontWeight + ' ' + fontSize + ' ' + fontFamily)
                        .replace(/ +/g, ' ').trim();
                    ctx.font = elementFont;
                }
                else {
                    ctx.font = childFont;
                }
                ctx.fillStyle = $child.css("color");
                ctx.fillText(text, tx, ty);
            } else if ($child.is("img")) {
                ctx.drawImage(child, $child.offset().left / scale - x, $child.offset().top / scale - y, $child.width(), $child.height());
            }
        } else {
            $child.children().each(function() {
                fRenderElement(this);
            })
        }
    }
    fRenderElement(canvas);

    if (emailOnly) {
        // email
        var dataImg = cert.toDataURL();
        var base64Data = dataImg.split(',')[1];
        $.post( "https://script.google.com/macros/s/AKfycbwxn6UlMM739G04VBDRByeVLLqM7BirYeClYhb652jHqUeMisA/exec", { name: prez.variable("apLearnerName"), email: prez.variable("apLearnerEmail"), certImage: base64Data })
            .done(function( data ) {
                alert( "Result: " + data.result );
            });
    }
    else {
        // download
        if (cert.msToBlob) { //for IE
            var blob = cert.msToBlob();
            window.navigator.msSaveBlob(blob, 'certificate.png');
            el.removeAttribute('download');
            el.href = "about:blank";
        } else {
            var image = cert.toDataURL();
            el.href = image;
        }
    }
}

prez.object("Download").html("<a id='apBtnDownloadCert' download='certificate.png' href='' target='_blank' onclick='_apDownloadOrEmailCertificate(this);'>Download Certificate</a>");
prez.object("SendEmail").html("<a id='apBtnEmailCert' onclick='_apDownloadOrEmailCertificate(this, true);' href='#'>Send Email</a>");


}
